import React from 'react'


function AudioMessage({message}) {

    const audio = new Audio(message.recordURL)
    return (
        <div>
           <audio style={{color:'green'} }controls>
              <source 
              src={message.recordURL} 
              type="audio/mp3"/>
            </audio>
        </div>
    )
}

export default AudioMessage
